description:
De goa'uld en de replicators vormen een vaste bedreiging. Er wordt kennisgemaakt met de Unas, de eerste gastheer van de goa'uld. Apophis wordt uiteindelijk overwonnen


9.Scorched Earth - 25 augustus 2000 - Stargate SG-1 begeleidt een kolonisatiepoging van een erg gevoelig ras. Het blijkt dat een ander buitenaards ras de planeet ook voor kolonisatie geschikt acht, en daartoe de hele planeet steriliseert.

10.Beneath the Surface - 1 september 2000 - De geheugens van de leden van SG-1 wordt gewist waarna ze aan het werk gezet worden in een ondergrondse faciliteit.

11.Point of No Return - 8 september 2000 - Een man die overal complotten inziet weet verdacht veel van het Stargate programma.

12.Tangent - 15 september 2000 - De luchtmacht heeft een Death Glider omgebouwd om er gebruik van te maken. O'Neill en Teal'c gaan een testvlucht maken, maar helaas gaat er iets mis.







